    <script>
    // Add Locate Me button after map loads
    setTimeout(function() {
        // Find the map object (Folium creates it with a variable name like map_xxxxx)
        var mapDiv = document.querySelector('.folium-map');
        if (!mapDiv) return;

        var mapId = mapDiv.id;
        var mapVar = window[mapId];

        if (!mapVar) return;

        // Create locate button
        var locateButton = L.control({position: 'topright'});

        locateButton.onAdd = function(map) {
            var div = L.DomUtil.create('div', 'leaflet-bar leaflet-control');
            div.innerHTML = '<a href="#" id="locate-me-btn" style="background-color: white; width: 34px; height: 34px; display: flex; align-items: center; justify-content: center; text-decoration: none; border-radius: 4px; box-shadow: 0 1px 5px rgba(0,0,0,0.4); font-size: 18px;" title="Locate Me">üìç</a>';

            div.onclick = function(e) {
                e.preventDefault();
                e.stopPropagation();

                if (navigator.geolocation) {
                    // Show loading state
                    var btn = document.getElementById('locate-me-btn');
                    btn.innerHTML = '‚åõ';

                    navigator.geolocation.getCurrentPosition(
                        function(position) {
                            var lat = position.coords.latitude;
                            var lon = position.coords.longitude;

                            // Remove previous user marker if exists
                            if (window.userLocationMarker) {
                                mapVar.removeLayer(window.userLocationMarker);
                            }

                            // Add a marker at user's location
                            window.userLocationMarker = L.circleMarker([lat, lon], {
                                radius: 8,
                                fillColor: '#FF0000',
                                color: '#FFFFFF',
                                weight: 2,
                                opacity: 1,
                                fillOpacity: 0.8
                            }).addTo(mapVar);

                            window.userLocationMarker.bindPopup('<b>You are here!</b>').openPopup();

                            // Zoom to user location
                            mapVar.setView([lat, lon], 13);

                            // Reset button
                            btn.innerHTML = 'üìç';
                        },
                        function(error) {
                            alert('Unable to retrieve your location. Please enable location services.');
                            btn.innerHTML = 'üìç';
                        }
                    );
                } else {
                    alert('Geolocation is not supported by your browser');
                }

                return false;
            };

            return div;
        };

        locateButton.addTo(mapVar);
    }, 500);
    </script>
